MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "New CalibreInteractive includes support for running CalibrenmLVS, CalibrenmDRC, CalibrePERC, and CalibrexRC. The GUI includes the following new features:");
MGCAddSnippet(6, "Calibre Interactive is a GUI interface to Calibre nmDRC, Calibre nmLVS, Calibre parasitic extraction tools, and Calibre PERC. You can easily adjust rule file settings and run-time options without editing the rule file, then submit the Calibre job on a local, remote, or distributed computer resource. ");
MGCAddSnippet(7, "Calibre Interactive and Calibre RVE are essential components of an interactive workflow using Calibre physical verification tools. Calibre Interactive and Calibre RVE are integrated to most standard industry design tools,");
MGCAddSnippet(8, "Several requirements must be met to use Calibre Interactive.");
MGCAddSnippet(9, "Calibre Interactive and Calibre RVE can establish connections to most standard industry design tools. This section describes where to find setup and operation information. ");
MGCAddSnippet(10, "GUI Customization is done with a configuration file that uses configuration API commands and the JavaScriptJavaScript is a registered trademark of the Oracle Corporation. language for scripting. The configuration file changes the Calibre Interactive GUI, rather than creating a Customizations Setting dialog box, as with classic Calibre Interactive. As with classic Calibre Interactive, you can specify #DEFINE and Variable statements, and read and set GUI options. The new configuration file enables you to create new GUI pages, move GUI controls, and add GUI buttons that call a user-defined function.");
MGCAddSnippet(11, "A search toolbar, rule file loading, and other features make the Calibre Interactive GUI easy to use. ");
MGCAddSnippet(12, "The command descriptions use font properties and several metacharacters to document the command syntax. ");
MGCAddSnippet(13, "This chapter describes basic usage, such as starting a run, connecting to a design tool, and searching for controls. ");
MGCAddSnippet(14, "A runset is a text file created by Calibre Interactive to store the settings you specify in the GUI. You can load a runset into Calibre Interactive to restore the GUI interface to the saved settings. You also use a runset to run Calibre Interactive in batch mode.");
MGCAddSnippet(15, "Calibre Interactive runsets save the settings in the GUI so you can easily return to the same setup. There are preference settings and environment variables that affect loading and saving runsets. ");
MGCAddSnippet(16, "You can load Calibre Interactive runsets from the command line, from the GUI, by defining an environment variable, or by setting a startup preference. ");
MGCAddSnippet(17, "Calibre Interactive can read in classic Calibre Interactive runsets. When you save a runset it is automatically saved in the new runset format. Conversion issues are noted in the transcript.");
MGCAddSnippet(18, "You can specify runsets to load automatically on invocation with an environment variable. You can also specify that all runset options are saved rather than only non-default options. ");
MGCAddSnippet(19, "You can pre-populate the Load Runset Files dialog box with a list of runsets. You can also populate the recent files lists for runset and text files. The list of runsets and text files is given in a text file that is specified with an environment variable. ");
MGCAddSnippet(20, "When multiple runsets are loaded in Calibre Interactive, they are loaded in order and the settings loaded last take precedence. You can use multiple runsets to combine runsets that include different sets of options. For example, you can combine a basic runset with a second runset that contains settings for output options or host processor control.");
MGCAddSnippet(21, "The control file in Calibre Interactive contains the settings in the GUI. ");
MGCAddSnippet(22, "The Calibre Interactive control file provides all the information Calibre needs to process data, based on the settings you define in the user interface.");
MGCAddSnippet(23, "Calibre Interactive writes the control file to the run directory with a name that is based upon the loaded rule file, with preceding and succeeding underscores (_).");
MGCAddSnippet(24, "You can instruct Calibre Interactive to create a control file based on the current GUI settings. This is useful if you want to view the control file before starting the run.");
MGCAddSnippet(25, "Calibre Interactive can create a control file that you can use as the rule file for a command line Calibre run. The control file includes GUI settings from your Calibre Interactive setup, such as check selection, top cell name, and other settings. ");
MGCAddSnippet(26, "Rule files define the processing Calibre performs during a run. You specify the rule file for a Calibre Interactive run on the Rules pane. ");
MGCAddSnippet(27, "When working with rule files in Calibre Interactive you can view and edit the rule file, check the rule file syntax, select the rule checks to execute, and load rule file settings into the Calibre Interactive GUI.");
MGCAddSnippet(28, "Calibre uses the control file to define the run. The primary rule file that you define in the Rules pane is included in the Calibre run as an Include file in the Calibre Interactive control file. When Calibre compiles a control file, the settings in the control file take precedence over any corresponding settings in the rule file. In other words, the GUI settings at the time the job is initiated control how the job is run.");
MGCAddSnippet(29, "You can use environment variables in Calibre Interactive fields and runsets with some restrictions.");
MGCAddSnippet(30, "You can work with a simplified view of the Calibre Interactive GUI if you only need to change a basic set of options. ");
MGCAddSnippet(31, "Some options and setup procedures pertain to all of the Calibre Interactive applications.");
MGCAddSnippet(32, "You invoke Calibre Interactive from a design tool or from the command line. Calibre DESIGNrev and Cadence Virtuoso are supported. ");
MGCAddSnippet(33, "There are several options for setting up the timeout of your Calibre Interactive license. ");
MGCAddSnippet(34, "The Calibre Interactive command line has options to run in interactive mode or batch mode. You can also specify one or more runsets to open. ");
MGCAddSnippet(35, "The connection to a design tool is made automatically when you invoke Calibre Interactive from the design tool. You can also make the connection to the design tool manually after the GUI is invoked from the command line.");
MGCAddSnippet(36, "You can use the open design in a layout or schematic viewer as input for your Calibre run; this is referred to as layout and schematic export. Layout and schematic export can also be used in a batch mode Calibre Interactive run with an additional setting. ");
MGCAddSnippet(37, "There are several methods for populating the fields in the Calibre Interactive GUI. ");
MGCAddSnippet(38, "The settings in the Calibre Interactive GUI can come from several sources, including direct user input, a Calibre Interactive runset, and template settings.");
MGCAddSnippet(39, "You can instruct Calibre Interactive to automatically load a rule file. The rule file is loaded when a runset is loaded and reloaded at runtime if the rule has been modified. You can choose whether or not to have a confirmation prompt displayed when the rule is about to be loaded.");
MGCAddSnippet(40, "The settings present in the Calibre Interactive GUI at the time of the run always take precedence over rule file settings if there is a conflict. This behavior allows you to customize your Calibre Interactive run without editing the rule file. However, in some cases you may want to insure that rule file settings are used for the run, or disable changes in portions of the Calibre Interactive GUI. Several features are available to manage requirements like this.");
MGCAddSnippet(41, "You provide OpenAccess database input on the Inputs page in Calibre Interactive. You specify database conversion options on the OA/LEFDEF page. The page name is OPENACCESS for Calibre Interactive PEX.");
MGCAddSnippet(42, "You can read LEF/DEF input from design files using Calibre Interactive. ");
MGCAddSnippet(43, "To set up the GUI for a run, click each of the page names on the left panel of the GUI and fill in the required fields. ");
MGCAddSnippet(44, "You can run Calibre Interactive in batch mode without opening the GUI. All Calibre Interactive options are set in the runset. ");
MGCAddSnippet(45, "You can export the design from an open design tool for use as input for the Calibre Interactive batch run. ");
MGCAddSnippet(46, "You specify a TVF rule file in Calibre Interactive on the Rules pane just as you do for an SVRF rule file. Some additional options are available when running with a TVF rule file. Debugging methods can be slightly different with a TVF rule file. ");
MGCAddSnippet(47, "The method for the checks that are executed in a Calibre Interactive run depends on which application you are running. ");
MGCAddSnippet(48, "A Check Selection Recipe is a set of expressions for selecting the checks to execute during a Calibre run. You can use built-in check recipes or create user-defined check recipes tailored for specific cases. Check Selection Recipes are used in Calibre Interactive nmDRC and Calibre Interactive nmLVS for ERC checks. The recipes are saved to the runset. ");
MGCAddSnippet(49, "The Check Selection Recipe specifies the checks that are executed in a Calibre Interactive nmDRC or nmLVS run. You can use a built-in check recipe or define your check recipe.");
MGCAddSnippet(50, "You can create a new custom check recipe or copy an existing recipe from the Check Selection Recipe Editor dialog box. Custom check recipes (also called user recipes) allow you to control which Calibre rule checks are executed during a Calibre nmDRC or Calibre nmLVS run. Check recipe definitions are saved in the Calibre Interactive runset, along with the currently active check recipe. ");
MGCAddSnippet(51, "The basic editing controls allow you to construct check recipes based on a short list of common expressions, such as  Checks selected in the rule file  and  Checks with density . You can also include and exclude individual checks and check groups. ");
MGCAddSnippet(52, "The advanced editing controls in the Recipe Editor allow you to select checks by layer and group, apply a wildcard filter, and select and unselect individual rule checks. ");
MGCAddSnippet(53, "You can subtract the check expression  Checks not selected in the rules file  from a custom check recipe in order to run only checks that are selected in the rule file. This step is necessary because most check expressions do not obey DRC [Un]Select Check statements in the rule file. ");
MGCAddSnippet(54, "The Recipe Editor page includes controls to create, copy, save, and edit a check selection recipe. Basic and advanced editing controls are available. ");
MGCAddSnippet(55, "Calibre Interactive allows you to quickly view and edit environment variables relevant to your design. The environment variables referenced in your rule file are automatically listed in the Environment page. In addition to viewing rule file environment variables, you can view the environment variables defined in the shell session and create and edit runset environment variables. ");
MGCAddSnippet(56, "Calibre Interactive automatically saves your startup preferences to special setup files, stored in your $HOME directory by default. Separate setup files allow you to define different startup preferences for the different Calibre Interactive applications. ");
MGCAddSnippet(57, "You can use file naming templates to form the names that Calibre Interactive generates. The template preference settings are applied when you invoke Calibre Interactive from a layout or schematic editor. Template settings make use of the cell and view open in the design tool to name input and output files. You define file naming templates in the Templates page (Settings > Show PagesTemplates).");
MGCAddSnippet(58, "You can use a template definition to create an output file name based on the top cell in the design. The method for doing this is shown in an example and with a short video. ");
MGCAddSnippet(59, "You may sometimes see that saved runset settings are not used when you open Calibre Interactive from a design tool. This occurs because templates are used to fill in certain GUI fields based on the open design when you launch Calibre Interactive from a design tool. You can disable templates if you want to use only saved runset options. You can disable all templates or delete the template for a specific GUI field. ");
MGCAddSnippet(60, "If Calibre Interactive is connected to a layout or schematic viewer, you have the option of specifying the open layout or netlist as the input file for the run; this is called layout or schematic export. You can set a preference for the export setting that is used when Calibre Interactive is invoked from a layout or schematic viewer. The preference setting is on the Templates page, under the Inputs section. This preference setting is not used in batch mode or command line execution.");
MGCAddSnippet(61, "This chapter includes reference information for GUI pages. The settings for a Calibre run are made in several pages selected from the left panel of the Calibre Interactive GUI. Some pages, such as the Rules page, are similar in all applications.");
MGCAddSnippet(62, "The Options page for all Calibre Interactive applications has settings for including rule files, rule file statements, and layout text files. ");
MGCAddSnippet(63, "The Database page has settings for precision, resolution, and additional layout and source input files. ");
MGCAddSnippet(64, "You can control database conversion options for third party databases using Calibre Interactive. ");
MGCAddSnippet(65, "The Environment page has controls to view and define environment variables for the Calibre Interactive run. ");
MGCAddSnippet(66, "You set the host processor, run, and licensing options on the Run Control page. You can also set options to connect to a design tool and specify whether to open Calibre RVE after the run. ");
MGCAddSnippet(67, "The Triggers page defines trigger functions that execute before and after the batch Calibre run. Trigger functions can run in the shell environment or in the design tool environment. Trigger definitions are saved in the runset. You can also specify trigger functions in the custom configuration file. ");
MGCAddSnippet(68, "The Templates page has settings for file-naming templates, which form the names that Calibre Interactive generates. For example, you can specify input and output filenames based on the open cell in a connected design tool. ");
MGCAddSnippet(69, "The Preferences page has settings for loading and saving the runset, saving the transcript, loading a custom configuration file, and other settings.");
MGCAddSnippet(70, "The runset preferences in Calibre Interactive control the runset open, close, and save behavior, and runset tagging information.");
MGCAddSnippet(71, "The Rules preferences in Calibre Interactive control behavior for reading, saving, and loading the rule file.");
MGCAddSnippet(72, "You can disable several Calibre Interactive options on the Preferences page. The available disable options depend on the run type. ");
MGCAddSnippet(73, "The miscellaneous (Misc) preferences in Calibre Interactive control warnings and prompts, automatic behaviors, and other options.");
MGCAddSnippet(74, "The Search toolbar finds matches to a search string. The behavior depends on the GUI page that is active. You can also enter runset option names to find the corresponding control. ");
MGCAddSnippet(75, "The layer derivation tree displays the layers found in the rule file and the sequence of derivations that lead up to a particular derived layer. The layer derivation tree also displays the checks and device definitions found in the rule file and the corresponding layer derivations. The layer derivation tree is available for all Calibre Interactive applications.");
MGCAddSnippet(76, "You can specify inputs, outputs, and options for a Calibre nmDRC run using Calibre Interactive nmDRC.");
MGCAddSnippet(77, "You can control inputs, outputs, and options for Calibre nmDRC run using Calibre Interactive.");
MGCAddSnippet(78, "The Check Selection Recipe specifies the checks that are executed in a Calibre Interactive nmDRC run. You can use a built-in check recipe or define your own check recipe. ");
MGCAddSnippet(79, "You can run DRC checks on only a specified rectangular area of the layout. Area DRC checks the specified area plus a halo region around the area. You can specify the halo size and whether results in the halo region are filtered out or kept.");
MGCAddSnippet(80, "Calibre Interactive nmDRC can create a Check Text Override file to control layer visibility for highlight actions and to define categories for filtering by category. The CTO file is used by Calibre RVE for DRC and DRC HTML reporting. The automatically generated CTO file causes only the layers used in the rule check to be displayed when highlighting a result. Category definitions are optional.");
MGCAddSnippet(81, "You can have Calibre Interactive nmDRC automatically create a DRC HTML Report after the Calibre run is finished. You can use a pre-defined configuration file or specify your own configuration file for the report format. Highlight images are automatically included. A shell script is created so that you can run the report at a later time from the command line. ");
MGCAddSnippet(82, "You can choose to report DRC results in local cell coordinates or top cell space. By default Calibre Interactive nmDRC reports errors in local cell space. This option is for Calibre nmDRC‑H only.");
MGCAddSnippet(83, "Use this option to control the number of results reported for each DRC rule check.");
MGCAddSnippet(84, "You can perform a Calibre FastXOR layout comparison using Calibre Interactive. ");
MGCAddSnippet(85, "You can start a Calibre FastXOR run from Calibre Interactive nmDRC. Calibre FastXOR is targeted for comparison between design iterations and can complete XOR comparison many times faster than traditional XOR flows. ");
MGCAddSnippet(86, "The Fast XOR page has options related to automatically generating the rule file for a Calibre FastXOR run. The page also has options for the report file, RDB file, and DBdiff template file. ");
MGCAddSnippet(87, "Some GUI pages are specific to Calibre Interactive nmDRC. ");
MGCAddSnippet(88, "The Options page includes settings that control the Calibre nmDRC run. ");
MGCAddSnippet(89, "The Outputs page includes settings for the DRC results database, opening side RDBs, and for creating a CTO file, DRC HTML report, and DRC summary report. ");
MGCAddSnippet(90, "When verifying a design, some rule check violations may be waived by the foundry. A waived result is a violation that is considered acceptable for the design and process. Designers often want to eliminate waived errors from their Calibre results so they can focus on the errors that need to be fixed. You can perform many of the tasks related to Calibre Auto-Waivers using Calibre Interactive.");
MGCAddSnippet(91, "Calibre Auto-Waivers automates the process of applying waivers during design verification. ");
MGCAddSnippet(92, "In addition to the standard requirements for the Calibre application, there are additional licensing, rule file, and input file requirements when running Calibre Auto-Waivers with Calibre Interactive.");
MGCAddSnippet(93, "You can use Calibre Interactive to generate a waiver shape database for the Calibre Auto-Waivers flow. All the waiver setup parameters are controlled through Calibre Interactive, then the waiver_flow tool is used to create the waiver database. ");
MGCAddSnippet(94, "You can use Calibre Interactive to start a Calibre verification run with Calibre Auto-Waivers. The waiver setup parameters are specified on the Waivers page. The waiver run adds the  ‑waiver  option to the Calibre command line. ");
MGCAddSnippet(95, "You can specify inputs, outputs, and options for a Calibre nmLVS run using Calibre Interactive nmLVS. ");
MGCAddSnippet(96, "You can control inputs, outputs, and options for a Calibre nmLVS run using Calibre Interactive. ");
MGCAddSnippet(97, "Hcell files are used in hierarchical Calibre nmLVS to define the correspondence between layout and source cell names. ");
MGCAddSnippet(98, "You can specify ERC checks in Calibre Interactive nmLVS.");
MGCAddSnippet(99, "You can specify short isolation options in Calibre Interactive nmLVS. Short isolation helps pinpoint the location of layout shorts between texted nets. ");
MGCAddSnippet(100, "You can use the Trace Properties option in Calibre Interactive to override the Trace Property statements in your rule file. You can add new statements, edit existing statements, and disable statements. This feature is available in Calibre Interactive nmLVS and Calibre Interactive PERC on the Options page. ");
MGCAddSnippet(101, "You can use Calibre Interactive to override the LVS Box related statements in your rule file; this is done on the LVS page with the LVS Box, LVS Black Box Port, and LVS Black Box Port Depth options. You can add new statements, edit existing statements, and disable statements. ");
MGCAddSnippet(102, "You can use Calibre Interactive nmLVS to calculate the effectiveness of hcells in reducing the total hierarchical instance count of your design. You can also extract and view the hierarchical structure of the design. ");
MGCAddSnippet(103, "A number of options affect the output of your hcell analysis. ");
MGCAddSnippet(104, "Hcell analysis results are shown in four sub-tabs within the H-Cells page of Calibre Interactive nmLVS. ");
MGCAddSnippet(105, "Calibre Interactive nmLVS enables you to easily generate and use unique signature strings for devices. Device signatures enable the matching of devices in the layout to a specific geometric pattern, rather than matching to just the layers that are present.");
MGCAddSnippet(106, "You can use Calibre Interactive nmLVS to create a device signature file. Device signatures enable the matching of devices in the layout to a specific geometric pattern, rather than matching to just the layers that are present. The signature creation process from the GUI is a standalone step, separate from your LVS comparison or netlist extraction run. You can save the device commands with the generated device signatures to a new file or append to an existing file. ");
MGCAddSnippet(107, "Calibre Interactive nmLVS can include a device signature file in the Calibre nmLVS run. The controls are on the Signatures page in the GUI. ");
MGCAddSnippet(108, "Use the Edit Parameters for Device dialog box to specify the layers, pin names, and options used for device signature creation in Calibre Interactive.");
MGCAddSnippet(109, "The Layers File is used to define the device types, device layers, pin names and pin layers for signature creation. The entries in the Layers File populate the fields of the Edit Parameters for Device dialog box in Calibre Interactive. You create the Layers File with a text editor.");
MGCAddSnippet(110, "Several pages are specific to Calibre Interactive nmLVS. ");
MGCAddSnippet(111, "You can specify inputs, outputs, and options for a Calibre xRC run using Calibre Interactive PEX.");
MGCAddSnippet(112, "The Calibre Interactive PEX Graphical User Interface (GUI) is an interface to the Calibre xRC, Calibre xACT, and Calibre xACT 3D batch parasitic extraction tools. The Calibre Interactive PEX GUI allows you to specify command line options and selected rule file statements that execute the desired Calibre PEX application.");
MGCAddSnippet(113, "The Inputs pane includes the tabs for each type of input. Use these tabs to specify the inputs needed for your PEX run.");
MGCAddSnippet(114, "You can control inputs, outputs, and options for a Calibre xRC run using Calibre Interactive PEX. ");
MGCAddSnippet(115, "Iterative extraction runs the PDB stage multiple times with different parasitic elements extracted for different nets. This can improve simulation time because the netlist has fewer elements. ");
MGCAddSnippet(116, "The Blocks page displays an alphabetical list of cells found in the source netlist files. Each cell entry contains an expansion control and the number of placements of each subcell found within its parent cell. You can select the extraction format, extraction mode, cross-annotate flag, and output netlist file for each extracted cell.");
MGCAddSnippet(117, "You can specify probe points in your parasitic model using Calibre Interactive PEX. Probe points are used to verify timing from specific points on each net.");
MGCAddSnippet(118, "You can choose to simplify the backannotation of net geometries into Calibre View by selecting the  Net Geometry  option for Calibre View and the  Show Parasitic Polygons  option in the Calibre View setup.");
MGCAddSnippet(119, "You can use a file naming template to name the extracted parasitic netlist based on the cell, extraction type, netlist format, and format options. For example, if the netlist format is DSPF, the file extension can be set to .dspf. ");
MGCAddSnippet(120, "By default, the GUI executes all three PEX steps (Persistent Hierarchical Database creation, Parasitic Database creation and formatted pex netlist creation) each time you click Run PEX. You can select each step individually, if desired.");
MGCAddSnippet(121, "Several pages are specific to Calibre Interactive PEX. ");
MGCAddSnippet(122, "You can adjust LVS-related settings on the LVS page. These include power and ground net names, gate recognition and reduction, device filtering, LVS Report options, and LVS Box settings. ");
MGCAddSnippet(123, "You can specify inputs, outputs, and options for a Calibre PERC run using Calibre Interactive PERC. ");
MGCAddSnippet(124, "You can start a Calibre PERC topological run from Calibre Interactive. You can specify inputs, outputs, and run options using the GUI. ");
MGCAddSnippet(125, "You can start a Calibre PERC logic driven layout (LDL) run from Calibre Interactive. You can specify inputs, outputs, and run options using the GUI. ");
MGCAddSnippet(126, "You can specify a Calibre PERC Waiver description file in Calibre Interactive PERC. This causes the Calibre PERC Waiver flow to be used during the Calibre PERC run. ");
MGCAddSnippet(127, "You can generate a rule file for a Calibre PERC run with the Calibre PERC Rule Generator GUI. The rule checks that can be included are part of the high-level checks flow in Calibre PERC. You specify the various parameters and input files for each rule check using the rule generator GUI. ");
MGCAddSnippet(128, "You can specify the Calibre PERC cell-based flow in Calibre Interactive. This flow is part of the Calibre PERC LDL (Logic-Driven Layout) functionality. The flow assumes LEF/DEF design input instead of SPICE and performs topological checking without considering devices. ");
MGCAddSnippet(129, "You can customize the GUI by loading a configuration file. You can specify controls as hidden or not editable and define custom GUI panes. You can also specify #DEFINE and Variable statements that are added to the Calibre Interactive control file.");
MGCAddSnippet(130, "You can load a configuration file with a command line option, by specifying the configuration file with an environment variable, loading it from the GUI, or loading a runset with a configuration file specified. ");
MGCAddSnippet(131, "Calibre Interactive can load a Tcl customization file that was developed for classic Calibre Interactive. A new Custom page is created within the GUI and the customization controls are placed on the Custom page. ");
MGCAddSnippet(132, "You can easily customize the Calibre Interactive GUI using the Calibre Interactive Configuration Editor. You can add and hide GUI pages, move options to different pages, hide options, and make other GUI changes. You can also add controls for #DEFINE and Variable statements. ");
MGCAddSnippet(133, "The configuration file in Calibre Interactive is used to customize the GUI. Changes made to custom controls are saved to the Calibre Interactive runset. By default, only changed settings are saved to the runset. ");
MGCAddSnippet(134, "The configuration file in Calibre Interactive contains commands and specifications to customize the appearance of the GUI. ");
MGCAddSnippet(135, "The configuration file specifies a custom GUI configuration. You can specify new pages, hide pages, control the visibility of options, and add controls for #DEFINE and Variable statements. You can also connect a function to a GUI action such as changing a value. ");
MGCAddSnippet(136, "Objects defined in the Configuration section of the Calibre Interactive configuration file have a global scope. A global object is declared with the  property variant  keyword.");
MGCAddSnippet(137, "Arrays and key-value maps can be used in the Calibre Interactive configuration file with some limitations. ");
MGCAddSnippet(138, "Certain properties apply at the tool level to set overall behavior and appearance of the Calibre Interactive GUI. For example, you can specify the pages that are visible in the GUI. ");
MGCAddSnippet(139, "Certain properties are common to the all GUI objects for option settings. For example, you can specify the tooltip, label, visibility, and the page on which an option is displayed. The objects created by the configuration API commands also have some of the same option properties. ");
MGCAddSnippet(140, "You can connect functions to signals generated by the GUI. Signals are generated when a property value changes and from user-defined buttons. ");
MGCAddSnippet(141, "You can use the hyperlink option property to add a link to a custom control. The hyperlink property is supported for addHeader, addLabel, and the commands that add Variable, #DEFINE, and #UNDEFINE statements to the control file. ");
MGCAddSnippet(142, "The configuration file uses the same option names as the runset file. You can determine option names by saving a runset in which only the options of interest have non-default settings. ");
MGCAddSnippet(143, "The configuration file in Calibre Interactive supports many commands for GUI customization. ");
MGCAddSnippet(144, "The Calibre Interactive configuration file has functions to add and remove pages, write to the transcript, add a separator line, and add text to the GUI. With the exception of the transcript function, these functions do not affect the Calibre run. ");
MGCAddSnippet(145, "Specifies various custom items to be grouped together. ");
MGCAddSnippet(146, "Adds a header label with a shaded background to the Calibre Interactive GUI. ");
MGCAddSnippet(147, "Adds a text label to the Calibre Interactive GUI. ");
MGCAddSnippet(148, "Specifies that the visibility of a control depends on the state of another control (the primary control) defined in the Calibre Interactive configuration file. ");
MGCAddSnippet(149, "Specifies that the visibility of a control depends on the state of another control (the primary control) defined in the Calibre Interactive configuration file. The dependent control is displayed if the primary control is not selected. ");
MGCAddSnippet(150, "Specifies that the visibility of a control depends on one or more other controls (the primary controls) that are defined in the Calibre Interactive configuration file. The logic for displaying the dependent control is defined with an expression involving the primary controls. ");
MGCAddSnippet(151, "Specifies that the visibility of a control depends on one or more other controls (the primary controls) that are defined in the Calibre Interactive configuration file. The logic for displaying the dependent control is determined by a function defined in the configuration file. ");
MGCAddSnippet(152, "Specifies a group of exclusive define controls, in which only one can be enabled at a time. ");
MGCAddSnippet(153, "Adds a custom page to the Calibre Interactive GUI or changes the page order of an existing page. ");
MGCAddSnippet(154, "Adds a separator line with an optional text label to the Calibre Interactive GUI. ");
MGCAddSnippet(155, "Adds a table to the Calibre Interactive GUI. ");
MGCAddSnippet(156, "The tool.envVars object includes function calls to read and set environment variables from the Calibre Interactive custom configuration file. ");
MGCAddSnippet(157, "The FileIO component and associated functions provide the means to perform file I/O with the Calibre Interactive custom configuration file. ");
MGCAddSnippet(158, "Returns a string containing the Calibre version, for example v2017.3_0.74. ");
MGCAddSnippet(159, "Returns the process ID for the Calibre Interactive GUI. ");
MGCAddSnippet(160, "Returns a Boolean value indicating whether the specified option name exists. ");
MGCAddSnippet(161, "Removes a page from the Calibre Interactive GUI. Pages with invalid objects are visible even when removed.");
MGCAddSnippet(162, "Defines the order of controls on a page in Calibre Interactive. ");
MGCAddSnippet(163, "Outputs text to the transcript. ");
MGCAddSnippet(164, "The custom configuration file in Calibre Interactive has commands available that call other commands or functions. The commands specify a callback function and provide a way to execute a shell command. ");
MGCAddSnippet(165, "Specifies a function to execute on a signal from the Calibre Interactive GUI. ");
MGCAddSnippet(166, "Executes an external (shell) command. ");
MGCAddSnippet(167, "Executes an external (shell) command that returns a string. ");
MGCAddSnippet(168, "Several commands are available for the Calibre Interactive custom configuration file that add a #DEFINE or #UNDEFINE statement to the Calibre Interactive control file. ");
MGCAddSnippet(169, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a value to the Calibre Interactive GUI; the value is taken from an enumerated list. The statement is added to the control file. ");
MGCAddSnippet(170, "Adds a control to specify a #DEFINE or #UNDEFINE statement with no value to the Calibre Interactive GUI. The statement is added to the control file. ");
MGCAddSnippet(171, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to a directory used for input. The statement is added to the control file. The control includes a text input field and a browser button for selecting the directory. ");
MGCAddSnippet(172, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to an input file. The statement is added to the control file. The control includes a text entry field, a file browser button for selecting the file, and a view file button. ");
MGCAddSnippet(173, "Adds a control to specify a #DEFINE or #UNDEFINE statement with an integer value to the Calibre Interactive GUI. The statement is added to the control file. ");
MGCAddSnippet(174, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to a directory used for output. The statement is added to the control file. The control includes a text input field and a browser button for selecting the directory. ");
MGCAddSnippet(175, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to an output file. The statement is added to the control file. The control includes a text input field, a file browser button for selecting the file, and a view file button. ");
MGCAddSnippet(176, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a floating-point value to the Calibre Interactive GUI. The statement is added to the control file. ");
MGCAddSnippet(177, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive GUI. The GUI control is a multi-line text box. The statement is added to the control file. ");
MGCAddSnippet(178, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive GUI. The statement is added to the control file. ");
MGCAddSnippet(179, "Several functions are available for the Calibre Interactive custom configuration file that add a Variable statement to the Calibre Interactive control file.");
MGCAddSnippet(180, "Adds a control to specify a Variable statement with a value to the Calibre Interactive GUI; the value is taken from an enumerated list. The statement is added to the control file. ");
MGCAddSnippet(181, "Adds a control to specify a Variable statement to the Calibre Interactive GUI, where the assigned value for the variable is a list. The statement is added to the control file. ");
MGCAddSnippet(182, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to a directory used for input. The Variable statement is added to the control file. The control includes a text entry field and a browser button for selecting the directory.");
MGCAddSnippet(183, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to an input file. The Variable statement is added to the control file. The control includes a text entry field, a file browser button for selecting the file, and a view file button.");
MGCAddSnippet(184, "Adds a control to specify a Variable statement with an integer value to the Calibre Interactive GUI. The statement is added to the control file. ");
MGCAddSnippet(185, "Adds a control to specify a Variable statement with a value to the Calibre Interactive GUI. The value is taken from an enumerated list and multiple values can be selected. The statement is added to the control file. ");
MGCAddSnippet(186, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to a directory used for output. The Variable statement is added to the control file. The control includes a text entry field and a browser button for selecting the directory.");
MGCAddSnippet(187, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive GUI, where the string value is expected to correspond to an output file. The Variable statement is added to the control file. The control includes a text entry field, a file browser button for selecting the file, and a view file button.");
MGCAddSnippet(188, "Adds a control to specify a Variable statement with a floating-point value to the Calibre Interactive GUI. The statement is added to the control file. ");
MGCAddSnippet(189, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive GUI. The GUI control is a multi-line text box. The statement is added to the control file. ");
