MGCAddSnippet(191, "You can add buttons to the Calibre Interactive GUI and specify a callback function that is executed when the button is clicked. ");
MGCAddSnippet(192, "Adds a user-defined button with a callback function to the Calibre Interactive GUI.");
MGCAddSnippet(193, "Adds a user-defined button with a callback function to the Calibre Interactive GUI. The button has a dropdown list of choices. ");
MGCAddSnippet(194, "Several commands are available for the Calibre Interactive custom configuration file to specify pre- and post-execution trigger functions. The trigger functions can run before or after the batch Calibre run, and can run in the shell environment or the design tool environment. ");
MGCAddSnippet(195, "Certain filenames and other parameters from the Calibre Interactive GUI can be passed to a trigger function using replaceable parameters. For example, the top cell name and the source netlist name can be passed to a trigger function using the replaceable trigger parameters %L and %s, respectively. ");
MGCAddSnippet(196, "A set of function calls to add trigger definitions to the Triggers page in the Calibre Interactive GUI. Triggers can execute in the shell environment or the design tool environment. They can execute before or after Calibre execution. ");
MGCAddSnippet(197, "This section provides a conversion guide and examples to assist in converting existing Tcl-based customization files to the new configuration file format for Calibre Interactive. ");
MGCAddSnippet(198, "This section provides a table listing Tcl customization commands and the corresponding command for the new configuration file format. Some typical Tcl scripting commands and the corresponding command in the new configuration file are also given. ");
MGCAddSnippet(199, "The Tcl customization file uses CUSTOM:VARIABLE, CUSTOM::DEFINE with the ‑choices option, and CUSTOM::LABEL with the ‑tool option. The equivalent new configuration file uses addIntegerVariable, addChoicesDefine, and addLabel. It checks for the tool version with the tool.name property. ");
MGCAddSnippet(200, "The Tcl customization file in this example uses CUSTOM::getRunsetVarValue, CUSTOM::setRunsetVarValue, and CUSTOM::setOKCallback to set a runset value from the Customization GUI. The new configuration file places GUI controls on a new page to accomplish the same function. ");
MGCAddSnippet(201, "The Tcl customization file uses CUSTOM::setOKCallback to associate a function with the OK button in the Customization GUI. The callback function is executed if a checkbox in the Customization GUI is checked. The new configuration file creates a button and uses the connect() function to connect a a function to the button click. ");
MGCAddSnippet(202, "There are some common errors in writing the configuration file for customization the Calibre Interactive GUI. This section outlines methods for finding and fixing these errors. ");
MGCAddSnippet(203, "Calibre Interactive can execute trigger functions before and after Calibre Interactive execution and before and after the Calibre run.");
MGCAddSnippet(204, "Triggers are functions that execute at specific times in your work flow. Calibre Interactive has two types of triggers: external, which execute before and after Calibre Interactive, and internal, which execute before and after the Calibre run. ");
MGCAddSnippet(205, "Internal triggers are functions that run before or after the batch Calibre run. They are defined in Calibre Interactive and saved to the runset. ");
MGCAddSnippet(206, "Calibre Interactive provides the ability to specify and run pre- and post-execution internal triggers. The trigger program is run immediately before or after batch Calibre. A trigger can be any program or script that can be executed from the Linux shell. Triggers can also run in supported design tools; in this case the trigger is written in the API language for the design tool. ");
MGCAddSnippet(207, "Various filenames and other key values specified in the GUI can be passed as replaceable parameters that are expanded and passed to the internal trigger program. ");
MGCAddSnippet(208, "You can instruct Calibre Interactive to run internal triggers before and after the Calibre run. Multiple trigger functions may be specified for each stage. If you are connected to a supported design tool, you can also specify procedures that run in the design tool environment. ");
MGCAddSnippet(209, "The Triggers tab on the Setup Preferences dialog box allows you to specify triggers that run in the design tool environment (the trigger Type of  layout  or  schematic .) By default, a layout or schematic trigger can only run in the design tool session that launched the Calibre Interactive session. ");
MGCAddSnippet(210, "Several examples are provided for Calibre Interactive internal triggers.");
MGCAddSnippet(211, "This example calls the  echo  utility with the trigger parameter %d as an argument. %d is replaced by the run directory at runtime.");
MGCAddSnippet(212, "This example calls a custom script with the trigger parameter %r as an argument. %r is replaced by the rule file path at runtime.");
MGCAddSnippet(213, "In this example an internal pre-execution trigger parses the topcell parameter and creates a file that is used as an INCLUDE file with the rule file for the Calibre run. The created file contains a Variable statement.");
MGCAddSnippet(214, "You can specify a Calibre Interactive internal trigger that runs in Calibre DESIGNrev and counts the number of cells in the layout. ");
MGCAddSnippet(215, "In some development environments, a system administrator may define a global or project-level runset that sets options for all Calibre Interactive applications. In this case, it can be useful for the same runset to define internal pre‑ and post‑execution triggers that differ according to Calibre Interactive application.");
MGCAddSnippet(216, "Calibre Interactive external triggers operate when you start Calibre Interactive from a layout or schematic viewer that supports external triggers. External triggers are written in the API for the supported design environment using the API language (Tcl, SKILL, or Scheme, for example). The triggers can be used to run custom routines that check or set environment variables or call setup and post-processing functions. ");
MGCAddSnippet(217, "External triggers execute in the design tool environment before and after Calibre Interactive execution. There are two types of external triggers: pre-execution and post-execution. ");
MGCAddSnippet(218, "The external trigger functions and the file locations depend on the design tool that is used. ");
MGCAddSnippet(219, "You can define Calibre Interactive external pre- and post-execution triggers in Calibre DESIGNrev. This section gives the function name and the location of the file containing the function definition. ");
MGCAddSnippet(220, "You can define Calibre Interactive external pre- and post-execution triggers in Cadence Virtuoso. This section gives the procedure name and the location of the file containing the procedure definition. ");
MGCAddSnippet(221, "You can define Calibre Interactive external pre- and post-execution triggers in Synopsys IC Compiler. This section gives the procedure name and the location of the file containing the procedure definition. ");
MGCAddSnippet(222, "Tcl and SKILL examples are provided for Calibre Interactive external triggers. ");
MGCAddSnippet(223, "The following code is an example of a pre-execution external trigger in Tcl. ");
MGCAddSnippet(224, "The following example shows an external pre-execution trigger in the SKILL language for the Cadence Virtuoso design environment. This procedure can be defined in your .cdsinit file. The trigger defines a runset using an environment variable. ");
MGCAddSnippet(225, "The sections in this chapter provide important information about setting up Calibre jobs and choosing a licensing behavior. ");
MGCAddSnippet(226, "Calibre Interactive enables you to run Calibre jobs on local, remote, and distributed resources. You can choose single threaded, multithreaded, or distributed execution with a choice of options such as number of CPUs and hyperscaling.");
MGCAddSnippet(227, "Calibre MTflex allows you to use your existing network as a low-cost distributed computing platform. ");
MGCAddSnippet(228, "You can specify that your Calibre Interactive job runs on the IBM Spectrum LSF computing system. ");
MGCAddSnippet(229, "When running Calibre on a remote host, you can use Calibre Interactive to set parameters such as executable paths and environment variables that control remote host execution.");
MGCAddSnippet(230, "You can control licensing options using Calibre Interactive.");
MGCAddSnippet(231, "This section provides detailed information on run control options such as hyperscaling, backup data, and remote data server (RDS). ");
MGCAddSnippet(232, "Hyperscaling is a mode of multithreaded operations that improves performance and scalability of CPU usage. It is enabled through the  Hyperscale  option on the Performance tab of the run Control pane. It enables the same functionality as the -hyper command line switch for the Calibre batch tools.");
MGCAddSnippet(233, "When  Hyperscale Compare  is enabled, Calibre nmLVS-H runs certain portions of LVS comparison concurrently with LVS circuit extraction. This reduces the run time for a hierarchical LVS run that requires both extraction and comparison. ");
MGCAddSnippet(234, "When  Hyperscale PathChk  is enabled, Calibre nmLVS-H runs certain portions of LVS comparison concurrently with Pathchk layer operations in hierarchical databases. This option is useful if Pathchk operations take the majority of time in a hyperscaling run. This option increases memory usage.");
MGCAddSnippet(235, "The Calibre Remote Data Server (RDS) technology is designed to reduce local (primary) memory requirements and improve Calibre MTflex performance by distributing data across remote hosts. ");
MGCAddSnippet(236, "Hyperscale Remote is an option that improves the performance and scaling of hyperscaling. Hyperscale Remote is available in  Distributed (MTflex)  mode when the Remote Data Server (RDS) Option is enabled. These options are not available for Calibre Interactive PEX. ");
MGCAddSnippet(237, "The Backup Data option enables recovery in the event of a catastrophic remote host failure; it uses the ‑recoverremote command line option. Backup Data is available in  Distributed (MTflex)  mode when the Remote Data Server (RDS) Option is enabled. These options are not available for Calibre Interactive PEX. ");
MGCAddSnippet(238, "The ability to communicate with industry standard design tools is an important feature of Calibre Interactive. This chapter discusses how to use Calibre Interactive with some of the design tool integrations. It also explains the setup procedure for the design tools that require custom installation and discusses special operating considerations. ");
MGCAddSnippet(239, "Some interface concepts and actions are common to all integrated layout and schematic viewers, as explained in these sections:");
MGCAddSnippet(240, "To start Calibre Interactive from an integrated viewer, choose the desired interface from the menu, depending on your viewer. ");
MGCAddSnippet(241, "Calibre Interactive uses certain default port numbers for socket communication with a connected layout or schematic viewer. The port numbers can also be set manually, as described here. Individual layout and schematic viewers may have additional methods for setting the port numbers; see the section for the specific viewer.");
MGCAddSnippet(242, "You can set the socket port manually using the Calibre Interactive GUI, or using an environment variable. By default, Calibre Interactive uses socket port 9189 to communicate with the layout viewer. The tool automatically searches for an available socket if it cannot obtain the default socket. It initializes the first available socket between the numbers 5000 and 9999 and reports the socket number through a dialog box. ");
MGCAddSnippet(243, "You can set the socket port manually using the Calibre Interactive GUI, or using an environment variable. By default, Calibre Interactive uses socket port 9199 to communicate with the schematic viewer. The tool automatically searches for an available socket if it cannot obtain the default socket. It initializes the first available socket between the numbers 5000 and 9999 and reports the socket number through a dialog box. ");
MGCAddSnippet(244, "You can add custom, or user-defined, menu items to supported design tools. The custom menu items are added to the integration menu.");
MGCAddSnippet(245, "The following procedure describes how to add custom menu items to the supported design tools. ");
MGCAddSnippet(246, "The menu customization file must be valid Tcl syntax. ");
MGCAddSnippet(247, "Several commands are available for creating custom menus in supported design tools. ");
MGCAddSnippet(248, "Returns the name of the design tool reading the menu customization file.");
MGCAddSnippet(249, "Adds a menu item to the indicated menu (by default, the root Calibre or Verification menu). Pre-execution code that executes in the design tool environment can also be specified for a command menu item. ");
MGCAddSnippet(250, "Removes an item from the indicated menu (by default, the root Calibre or Verification menu).");
MGCAddSnippet(251, "The menu labels for the Calibre integration changed in some design tools with the 2014.2 release. Menu customization files written for previous releases are still read correctly if they use the earlier menu label in the ‑before and ‑after options to specify the placement of a custom menu item. ");
MGCAddSnippet(252, "This customization file works with any supported design tool. It deletes the DFM and 3DSTACK menu items, and adds two new menu items and a submenu. ");
MGCAddSnippet(253, "Calibre DESIGNrev and Calibre WORKbench include a Verification menu for starting Calibre Interactive, Calibre RVE, and some Calibre Pattern Matching applications. ");
MGCAddSnippet(254, "By default, Calibre Interactive and Calibre RVE use socket port 9189 for communication. The tool automatically searches for an available socket if it cannot obtain the default socket. ");
MGCAddSnippet(255, "To start Calibre Interactive from Calibre DESIGNrev or Calibre WORKbench, choose Verification and choose the desired interface. ");
MGCAddSnippet(256, "The IC Station product family changed its name to Pyxis with the v10.0 release of Pyxis, and this manual therefore refers to the Pyxis product. Pyxis has a Calibre pulldown menu with selections to open Calibre Interactive and Calibre RVE. ");
MGCAddSnippet(257, "By default, Calibre Interactive and Calibre RVE use socket port 9189 to communicate with Pyxis Layout. The tool automatically searches for an available socket if it cannot obtain the default socket. ");
MGCAddSnippet(258, "Select the desired option from the Calibre menu to open the corresponding Calibre Interactive application. ");
MGCAddSnippet(259, "Calibre Interactive is integrated to the viewers Siemens Tanner S-Edit, a schematic viewer, and L-Edit, a layout design tool.");
MGCAddSnippet(260, "The following sections describe the Calibre interface to Cadence Virtuoso:");
MGCAddSnippet(261, "Calibre Interactive and Calibre RVE support Cadence Virtuoso versions 5.1, 6.1, 6.18, 12.1, 12.2, 12.3, and 18.1. ");
MGCAddSnippet(262, "The Calibre menu in Cadence Virtuoso layout and schematic windows (windows of type maskLayout or schematic by default) has the selections to start Calibre Interactive, start Calibre RVE, set up options, and map schematic nets.");
MGCAddSnippet(263, "You can control the layout export from Cadence Virtuoso with the Calibre Layout Export Setup dialog box and the Cadence Virtuoso template file. You can also use the Cadence Virtuoso streamOutKeys or oasisOutKeys variables. ");
MGCAddSnippet(264, "The Calibre Layout Export Setup dialog box sets options that control layout export from Cadence Virtuoso to Calibre. Environment variables and SKILL variables can be used in filenames. From Cadence, choose CalibreSetupLayout Export to open the layout export dialog box.");
MGCAddSnippet(265, "You can use a template file to control the layout export when using Calibre Interactive with Cadence Virtuoso. The template file is specified with the global variable mgc_calibre_export_layout_template_file (GDSII) or mgc_calibre_export_layout_oasis_template_file (OASIS) or using the GUI. ");
MGCAddSnippet(266, "Layout export functions are provided for Cadence Virtuoso.");
MGCAddSnippet(267, "Returns a string value consisting of the layout export command used by Calibre Interactive. ");
MGCAddSnippet(268, "SKILL command to load the layout template file specified by the SKILL variable mgc_calibre_export_layout_template_file or mgc_calibre_export_layout_oasis_template_file.");
MGCAddSnippet(269, "Calibre can read the design data directly from the OpenAccess database. This is called Direct Read, in contrast to Layout Export, in which Cadence Virtuoso converts the design to GDS format and streams it out to Calibre Interactive. ");
MGCAddSnippet(270, "Calibre Interactive automatically saves the Express Pcell cache when performing direct read of Cadence Virtuoso OpenAccess databases if the following conditions are met. ");
MGCAddSnippet(271, "Many aspects of netlist export from Cadence Composer are controlled with the Calibre Netlist Export Setup dialog box. The netlist export routines use the Simulation Interface system (si ‑batch) to translate the schematic to CDL when performing netlist export.");
MGCAddSnippet(272, "From Cadence, choose CalibreSetupNetlist Export to open the netlist export dialog box.");
MGCAddSnippet(273, "Netlist export functions are provided for Cadence Virtuoso. ");
MGCAddSnippet(274, "Returns a string value consisting of the netlist export command used by Calibre Interactive. ");
MGCAddSnippet(275, "Loads the netlist template file specified by the SKILL variable mgc_calibre_export_netlist_template_file.");
MGCAddSnippet(276, "The Calibre Interactive interface allows you to run Calibre on a Cadence Virtuoso cell. You can specify settings that control the layout export process.");
MGCAddSnippet(277, "The Calibre SKILL Interface uses a TCP socket to communicate with Calibre RVE and Calibre Interactive. When you load the calibre.skl file, the tool attempts to initialize a server socket at port 9189. If that port is being used, the tool searches for a free socket port in the range 5000 to 9999. ");
MGCAddSnippet(278, "It is often useful to call a SKILL procedure before or after your Calibre run. ");
MGCAddSnippet(279, "A Calibre View of a cell is a schematic view of a cell you can simulate in the Cadence Analog Design Environment. This schematic view contains the connectivity and intentional devices the Calibre LVS tool extracts, and, optionally, parasitic devices the Calibre xRC tool extracts. ");
MGCAddSnippet(280, "Producing a Calibre View requires the correct product licenses, input files, and integration setup. ");
MGCAddSnippet(281, "You can produce the Calibre Views after an LVS run or after a parasitic extraction run. ");
MGCAddSnippet(282, "When Calibre View uses OpenAccess, it must be a compatible version to the version of Cadence Virtuoso being used. Calibre View automatically detects which OpenAccess version to use and warns the user if the version they specified does not match.");
MGCAddSnippet(283, "Several internal steps are involved when device properties are calculated during Calibre View generation. ");
MGCAddSnippet(284, "The Calibre View generated view does not show nets with inherited connectivity that do not exist in schematic. ");
MGCAddSnippet(285, "The generated CalibreView netlist always uses <> as the bus delimiter to avoid conflicts with the standard Cadence schematic netlist, which uses <> as the bus delimiter. If you generate a CalibreView from a netlist which uses [] as the bus delimiter, pin and net names ending in [] are automatically converted to use <> as the bus delimiter. ");
MGCAddSnippet(286, "Before creating a Calibre View, you must create a cellmap file. A cellmap file is an ASCII mapping file used for mapping the layout device to the corresponding schematic symbol. Both intentional devices and parasitic devices can be mapped with the cellmap file.");
MGCAddSnippet(287, "The cellmap file is a text file that is used when creating a Calibre View.");
MGCAddSnippet(288, "The cellmap file is needed for creating a Calibre View.");
MGCAddSnippet(289, "The cellmap statement for intentional devices instructs the Calibre View process on how to map the device.");
MGCAddSnippet(290, "The cellmap statement instructs the Calibre View process on how to map the cell.");
MGCAddSnippet(291, "You can add property specifications to the cellmap file that determine how property information is passed from Calibre to the Calibre View. ");
MGCAddSnippet(292, "Each layer that is imported to a Calibre View requires a mapping statement to identify the corresponding Cadence layer name. ");
MGCAddSnippet(293, "This section describes the cellmap syntax for parasitic devices. ");
MGCAddSnippet(294, "The following cellmap file examples are included in this section:");
MGCAddSnippet(295, "You can have multiple devices with the same modelname, however each device should have different pin counts. ");
MGCAddSnippet(296, "You can map a Calibre device to a Cadence cell containing a greater number of pins. For example, the following cellmap entry would map a 2-pin Calibre device to a 3-pin device:");
MGCAddSnippet(297, "You can map nets connecting to a pin of a device the Calibre tool extracts to a property on a cell the Calibre View instantiates. ");
MGCAddSnippet(298, "The schematic property  fingers  is set to the number of fingers of the device. Since each individual finger in the layout needs fingers=1, we need to set this in the cellmap file, or the schematic property value will be applied to each finger of the device. ");
MGCAddSnippet(299, "This example uses expressions to map a Calibre property to Cadence properties. ");
MGCAddSnippet(300, "To create an optimized cellmap file, you should map the Connect statement layers and Device statement layers. ");
MGCAddSnippet(301, "Calibre layers can be mapped Cadence drawn layers in the cellmap file, and you need to identify the corresponding Calibre layer and Cadence drawn layer.");
MGCAddSnippet(302, "You can specify the cellmap file for Calibre View generation using Calibre Interactive PEX or Calibre Interactive xACT. At run time, the Calibre View cellmap file is also entered in the Cadence Virtuoso  Calibre View Setup  dialog box.");
MGCAddSnippet(303, "Because the Cadence Analog Design framework treats net and instance names in schematics case sensitively, you must add the Source Case statement to your SVRF rule file when creating a Calibre View.");
MGCAddSnippet(304, "Intentional devices and cells without mapping information in the cellmap file are automatically mapped (auto-mapped) and instantiated in the generated Calibre View. By default, the mapping uses case-sensitive matching of pin names followed by order-based mapping. You can specify a different auto-map behavior with the environment variable MGC_FDI_PIN_AUTOMAP_METHOD. You can also specify that information about the auto-map process be printed to the transcript with the environment variable MGC_FDI_ENABLE_AUTOMAP_LOGGING. ");
MGCAddSnippet(305, "The Calibre View Setup dialog box has settings for several aspects of the Calibre View creation process.");
MGCAddSnippet(306, "Calibre Interactive and Calibre RVE generate a Calibre View for the top-level cell, regardless of the cell context set in the tools. The tools generate net and device names in the Calibre View from the source (or schematic) name space, unless nets and devices were unmatched during LVS comparison. In the latter case, the tool prefixes layout names with a  _Layout .");
MGCAddSnippet(307, "The post-parasitic extraction Calibre View includes parasitic elements as well as intentional devices.");
MGCAddSnippet(308, "A gate-level Calibre View includes parasitics from the top-level routing plus symbols for the cells. ");
MGCAddSnippet(309, "When you generate a Calibre View with multiple corners selected for extraction, a Calibre View is created for each corner. ");
MGCAddSnippet(310, "You can generate a SPECTRE netlist from the Calibre View netlist using the Cadence Analog Design Environment (ADE). Cellmap information is used in the netlist generation, unlike the case when generating a SPECTRE netlist from Calibre xRC, in which source names are used. ");
MGCAddSnippet(311, "The CalibreView setup file contains all the settings necessary to generate a CalibreView. You can use the file as input to the SKILL function mgc_rve_load_setup_file to create the CalibreView in batch mode, without opening the Calibre View Setup dialog box. The file can also be loaded into the Calibre View Setup dialog box in order to populate the dialog box with saved settings. ");
MGCAddSnippet(312, "You can use the display and annotation of parasitic polygons to more easily analyze design parasitics. ");
MGCAddSnippet(313, "The CalibreView setup file allows you to specify the parameters for CalibreView creation without opening the Calibre View Setup dialog box. ");
MGCAddSnippet(314, "Several functions are provided that allow you to create a Calibre View from the command interpreter without opening the Calibre Interactive GUI or Calibre RVE. ");
MGCAddSnippet(315, "Several global variables are provided that are used in the creation of a Calibre View.");
MGCAddSnippet(316, "The SKILL function mgc_rve_load_setup_file() uses the parameters in the CalibreView setup file to create a CalibreView without opening the Calibre View Setup dialog box.");
MGCAddSnippet(317, "Calibre View creation is designed to work with the IC Manage integration to Cadence Virtuoso. ");
MGCAddSnippet(318, "This section describes warnings from Calibre View generation. ");
MGCAddSnippet(319, "The delimiter for bus names may be <> or [], depending on the convention used in the schematic netlist. You can convert the bus delimiter, if needed.");
MGCAddSnippet(320, "You can instruct the tool to convert the bus name delimiter from <> to [] when the schematic netlist is exported for a Calibre Interactive run.");
MGCAddSnippet(321, "In some cases Calibre Interactive or Calibre RVE is using [] as the bus name delimiter but the tool is interfacing with a Cadence schematic view that uses <> as the bus name delimiter. You can convert the bus name delimiter so that net selection and highlighting is handled correctly.");
MGCAddSnippet(322, "A typical step after parasitic extraction is the simulation of an extracted Calibre View in the Cadence Analog Design Environment. The method you use depends on whether you have multiple extracted Calibre Views or just one. ");
MGCAddSnippet(323, "A typical step after parasitic extraction is the simulation of an extracted Calibre View in the Cadence Analog Design Environment. You can select nets to plot using the selection CalibreMap Schematic Net from the Cadence Virtuoso Schematic Editor. ");
MGCAddSnippet(324, "A typical step after parasitic extraction is the simulation of an extracted Calibre View in the Cadence Analog Design Environment (ADE). After you select nets to plot in the Cadence Analog Design Environment, you can convert between CalibreView names and schematic names with the selections CalibreMap Schematic Nets to CalibreView Nets and CalibreMap CalibreView Nets to Schematic Nets. The text file extviews.txt provides the mapping between the extracted views and the cells.");
MGCAddSnippet(325, "When generating a Point to Point report to be viewed in the Map Schematic Nets to CalibreView Nets dialog box, you can include details on the resistances for specified nets. When enabled, information on each individual resistor is displayed.");
MGCAddSnippet(326, "When debugging parasitics in the design it is sometimes useful to backannotate the schematic with the extracted parasitic values. This can be done using the dialog box  Map Schematic Nets to CalibreView Nets . Backannotation can also be deleted.");
MGCAddSnippet(327, "Environment variables can be set by custom scripts, or with Calibre Interactive pre-execution triggers for use within the Cadence Design Environment. The following script shows how Calibre Interactive execution triggers can be used within the Cadence Design Environment to automatically specify a Calibre Interactive runset based on the technology library attached to the design.");
MGCAddSnippet(328, "The Cadence Composer integration is similar to that for Cadence Virtuoso.");
MGCAddSnippet(329, "Calibre includes software that enables seamless integration of Calibre Interactive and Calibre RVE within the Cadence Encounter platform. A Calibre menu is activated when the supplied software is loaded into the Encounter environment, usually through the cal_enc.tcl file. ");
MGCAddSnippet(330, "The following script can be inserted into the enc.tcl file to load the Calibre software:");
MGCAddSnippet(331, "You can populate the CalibreSetupVerilog Export dialog box with the parameters used by the saveNetlist command in Cadence Encounter. ");
MGCAddSnippet(332, "Calibre Interactive and Calibre RVE are integrated with the CadenceInnovus Implementation System. The Calibre menu is added when the integration code is loaded. ");
MGCAddSnippet(333, "Integration code must be loaded to enable the Calibre integration to Cadence Innovus. The integration is supported for Calibre RVE and all Calibre Interactive applications except Calibre Interactive 3DSTACK. ");
MGCAddSnippet(334, "Calibre provides an integration of Calibre Interactive and Calibre RVE to Synopsys IC Compiler and Synopsys IC Compiler II. The integration makes it easy to run Calibre flows in the Synopsys IC Compiler environment and debug the results. ");
MGCAddSnippet(335, "The interactive flow with Calibre Interactive, Calibre RVE, and Synopsys IC Compiler allows you to easily run Calibre and debug results. The flow with Calibre nmDRC is illustrated.");
MGCAddSnippet(336, "The Calibre interface to Synopsys IC Compiler supports the Calibre nmDRC, Calibre nmLVS, Calibre PERC, PEX, and DFM applications for both Calibre Interactive and Calibre RVE. The Calibre menu is available after the interface is loaded. Synopsys IC Compiler II is also supported. ");
MGCAddSnippet(337, "The Calibre interface can be loaded automatically each time you start Synopsys IC Compiler, or you can manually install the interface. The Calibre—IC Compiler interface supports Synopsys IC Compiler versions through 2014.9. Synopsys IC Compiler II version M-2016.12-SP2 is supported. ");
MGCAddSnippet(338, "The Calibre interface can be loaded automatically each time you start Synopsys IC Compiler II, or you can manually install the interface. Synopsys IC Compiler II version M-2016.12-SP2 is supported. ");
MGCAddSnippet(339, "The README file for the Calibre -IC Compiler integration is at the following location:");
MGCAddSnippet(340, "The Calibre menu is available after Calibre interface is loaded. The menu has selections to start Calibre Interactive, Calibre RVE, and to selection setup options.");
MGCAddSnippet(341, "All Calibre Interactive applications are supported: Calibre nmDRC, Calibre nmLVS, DFM, Calibre PERC, and PEX. ");
MGCAddSnippet(342, "Calibre Interactive and Calibre RVE communicate with Synopsys IC Compiler through a socket port. Socket communication is established automatically when you start Calibre Interactive or Calibre RVE from the Calibre menu in Synopsys IC Compiler. By default, Calibre Interactive and Calibre RVE use socket port 9189 for communication, and the tool automatically searches for an available socket if it cannot obtain the default socket.  Synopsys IC Compiler II is also supported.");
MGCAddSnippet(343, "Several common problem may occur in the Calibre Interface with Synopsys IC Compiler.");
MGCAddSnippet(344, "The Silvaco Expert design tool includes integrations to Calibre Interactive nmDRC, Calibre Interactive nmLVS, Calibre RVE, and a custom interface to launch a batch Calibre nmDRC job. You can use these interfaces to launch a Calibre verification run from Silvaco Expert, then use Calibre RVE to highlight the errors in the open design. ");
MGCAddSnippet(345, "Silvaco Expert requires the MGC_HOME environment variable to be set and pointing to the location of the Calibre installation. It is good practice to also define CALIBRE_HOME in the same manner.");
MGCAddSnippet(346, "Calibre Interactive and Calibre RVE use certain default port numbers for socket communication with a connected design tool. By default, Calibre Interactive and Calibre RVE use socket port 9189 to communicate with a layout editor. The tool automatically searches for an available socket if it cannot obtain the default socket. When Silvaco Expert successfully opens a socket, it reports the socket number to the log file.");
MGCAddSnippet(347, "The Calibre menu in Silvaco Expert is at VerificationCalibre. ");
MGCAddSnippet(348, "Some viewer integrations are not discussed here because the integration is straightforward and does not require any special setup actions or custom commands for operation.");
MGCAddSnippet(349, "Calibre Interactive and Calibre View generation read a number of environment variables that specify run-time behavior. Some environment variables apply to more than one application.");
MGCAddSnippet(350, "Several environment variables are available to control the behavior of Calibre Interactive. ");
MGCAddSnippet(351, "Several environment variables are available to control Calibre View generation.");
MGCAddSnippet(352, "A Calibre Interactive runset is a text file created by Calibre Interactive to store the settings you specify in the GUI. You can load a runset into Calibre Interactive to restore the GUI interface to the saved settings. This appendix gives the runset file format and option names. ");
MGCAddSnippet(353, "Calibre Interactive runset files are built automatically using the Calibre Interactive GUI. Although not recommended, it is possible to manually edit the options in a runset file.");
MGCAddSnippet(354, "The common runset options have the prefix cmn. ");
MGCAddSnippet(355, "DRC Runset Options. ");
MGCAddSnippet(356, "LVS Runset Options. ");
MGCAddSnippet(357, "PERC Runset Options. ");
MGCAddSnippet(358, "The Calibre Interactive PEX-specific runset options have the prefix xrc. ");
MGCAddSnippet(359, "Trigger definitions for Calibre Interactive are saved to the runset as object definitions and function calls. ");
MGCAddSnippet(360, "File-naming templates for the Calibre Interactive GUI are saved to the runset as function calls. ");
MGCAddSnippet(361, "Most waiver setup runset options start with cmn.waiver. The waiver options are used in Calibre Interactive nmDRC and in Calibre Interactive nmLVS with ERC enabled. ");
MGCAddSnippet(362, "");
MGCAddSnippet(363, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

